import React, {Component} from 'react';

class FetchText extends Component{
  constructor()
  {
    super();
    this.state={
      data: [],
    }
  }

  componentDidMount()
  {
    fetch('https://jsonplaceholder.typicode.com/todos/1')
    .then((response) => response.json())
    .then((findresponse)=>{
      console.log(findresponse.title)
      this.setState({
        data:findresponse.title,
      })
    })
  }

  render()
  {
    return(
        <div>
        <p> Below there should be some lorem ipsum text: </p>
        <p> {this.state.data} </p>
        </div>
    )
  }

}

export default FetchText;
